import React from "react";
import RowControl from "./RowControl";

class Card extends React.Component {
  state = {
    data: this.props.data
  };

  componentDidMount() {
    console.log("tesT");
  }

  getName = () => {
    if (this.state.data.indexOf("name") === -1) {
      return <div>Error: Name not found</div>;
    }
    return this.state.data[this.getIndex(this.state.data, "Name")][1];
  };

  renderData = () => {
    if (this.state.data !== undefined) {
      return this.state.data.map(entry => {
        if (entry[0] !== "Name") {
          return (
            <tr key={entry[0] + entry[1]}>
              <td>{entry[0]}</td>
              <td>{entry[1]}</td>
            </tr>
          );
        }
        return null;
      });
    }
    console.log("crash");
    return null;
  };

  render() {
    return (
      <div className="ui cards">
        <div className="card">
          <div className="content">
            <div className="header">{this.getName()}</div>
            <div className="description">
              <table className="ui celled table">
                <tbody>
                  <div>{this.renderData()}</div>
                </tbody>
              </table>
            </div>
          </div>
          <div
            className="ui bottom attached button"
            style={{ paddingTop: "5px", paddingBottom: "5px" }}
          >
            rowcontrol
          </div>
        </div>
      </div>
    );
  }
}

export default Card;
